alt-trans.target:
--protokoly | / logger: < Uri/FriendlyName protokolovacího nástroje >
      Zadejte protokolovací nástroj pro výsledky testů.  Výsledky do Visual Studio testovací výsledky souboru (TRX) použijte k přihlášení /logger:trx.
      Chcete-li publikovat výsledky testů na Team Foundation Server, použijte TfsPublisher jak je ukázáno níže
      Příklad: /logger:TfsPublisher;
                Kolekce = < adresa url kolekce projektu týmu >;
                BuildName = < název sestavení >;
                TeamProject = < název týmu projektu >
                [; Platforma = < výchozí hodnota je "Libovolný procesor" >]
                [; Charakter = < výchozí hodnota je "Ladění" >]
                [; RunTitle = < title >]
